(97, '0f91e47', '0f91e47', '', 'Hey Darren I know it\'s the weekend but just a quick courtsey update as promised.  The people whom are purchasing the car are extremely satisfied with the live videos, pre purchase vehicle inspection (organised through a person of their choice) and they have booked flights for Monday to fly down from Townsville and pick it up. They have also placed down a deposit. So unless they rock up and say no it\'s as good as sold for Monday!  So $50,000 essentially cash toward the property game.  Also Jarrod Rogers is my tax accountant from Beyond accountancy Melbourne, his Contact details are: 0422 117 590  I have not been able to get on to him as he works Tuesday till Thursday (according to his voicemail). I have also attached a notice of assessment which outlines that the tax dispute should be completed by 30th of this month. To the best of my knowledge it\'s a total of $22,000.', '2020-10-24 01:06:33', 1),
