(107, '0f91e47', '0f91e47', '', 'Reference Thailand.  This is all pending when the borders open. My dream and passion is to fight abroad. It\'s my main objective. I can live off the pension and not dip in to additional savings while living there expect for flights.  Currently Australian legislation stands I can leave Aus during covid 19, providing I leave Aus  for 3+ months.  Thailand have announced/anticipate that borders will be open to Australians early December. Ideally this is when I would like to go. They have extended their tourist visa to 9 months. Not the traditional 3 months. I would like to maximise the 9month tourist visa. Again as you can appreciate, no one knows formally when the borders will open but I\'m going off the aforementioned information. Respectively the borders may not open for 6 months. No one formally knows, but Thailand have started letting in select countries and Australia is due next', '2020-10-30 01:06:25', 1),
(108, '0f91e47', '949aec4', '0f91e47', 'Hi Dan, thanks for the update. In regards to Thailand, youâ€™re right, thereâ€™s no 100% defined answer around answer around brothers opening and so would need to asses at that time as the finance and banking structures are changing rules and updating legislation so frequently. However, at todayâ€™s notion, and expat abroad would be required to pay 30% deposit in a property. That doesnâ€™t necessarily stand the ground for a tourist visa though, as these are seen as travel purposes and not immigration purpose. IE, it just depends on if youâ€™re wanting to build a life there or enjoy a short stint. I hope that makes sense. ', '2020-10-30 03:39:16', 1),
(109, '0f91e47', '0f91e47', '', 'It makes perfect sense. It would be a 9 months extended tourist visa.', '2020-10-30 03:58:36', 1),
