(263, '3a15fd8', '3a15fd8', '', 'Hi Darren, thanks for the video and message. Yes, I can do a call tomorrow - could we do the afternoon? Say around 2-4pm. In terms of the roadmap, I did have some questions - I maybe too Sydney centric, but of the yields quite strong to what I\'ve seen. I presuming that is what is driving a faster property portfolio expansion that I would envision otherwise would hit serviceability issues? My other concern is the \'quality\' of $300-350k stock e.g. will there be other maintenance costs later on? will the price be more volatile over the medium term?    ', '2021-01-14 06:02:04', 1),
(264, '3a15fd8', '949aec4', '3a15fd8', 'Hi Ryan, thatâ€™s great mate, Iâ€™ve scheduled that in and sent you an invite. You\'re spot on there. These are not returned the can be expected in major metro markets and building a portfolio like this is faster and more growth and cash flow benefits in the long run. However, yes these properties are also not of the highest quality and over time would need maintenance (as do all properties) and in some cases possible a little more than others, which Iâ€™ve included in the maintenance costs in the video. The benefit of buying low is the imminent growth, this is the extractable portion. Once extracted and used to purchase again, there is still good growth potential in that property, obviously pending the market. ', '2021-01-14 06:26:49', 1),
(265, '3a15fd8', '949aec4', '3a15fd8', 'But I do want to clarify that this is not necessarily the path you want to take, weâ€™re happy to operate to your comfort, but it would be wrong of me to not show you the options. This is why we create the roadmaps. The difference is that higher price range properties grow at slower rates and as the value increases the market performance (generally speaking) decreases. I look forward to our chat tomorrow. Have a great evening. ', '2021-01-14 06:26:56', 1),
