(288, '23a224e', '23a224e', '', 'Hi Darren, hope you are well. Craig has got back to me on the finance serviceability assessment. And we will proceed with refi & approval in principle with anz. It should be a fairly swift process from our end. Not sure if Craig has had the chance to brief you, but he did suggest us to proceed with property searching and not wait up on him/bank. Delay is apparently due to awaiting valuation outcome from the bank for my Adelaide property. Please let me know your thoughts. Thanks. By the way, he did a solid job in calcs and presentation! ', '2021-01-20 05:13:27', 1),
(289, '23a224e', '949aec4', '23a224e', 'Hi Zhe, thatâ€™s great to hear and yes we have spoken and Iâ€™m across all areas. Iâ€™ve continued in the meantime and have locations which Iâ€™ll be presenting to you in very soon. Weâ€™re looking in a good positions :) Thanks for the message ', '2021-01-20 05:16:16', 1),
(290, '3a15fd8', '949aec4', '3a15fd8', 'Hi Ryan, youâ€™re locations will be up shortly. I also have a shortlist of some great options which I would like to jump on asap. Just going through the brokers email and I just want to confirm that finance is definitely approved? Itâ€™s good to have this in place for negotiations, if required. I only ask this because Tommy Lim mentioned getting back you you after the 7th. Thanks ', '2021-01-20 05:45:49', 1),
(291, '3a15fd8', '3a15fd8', '', 'Excellent thanks. Iâ€™ll have a look when it comes through. I havenâ€™t got finance confirmed yet as they are still going through options. I will follow up again. ', '2021-01-20 06:47:48', 1),
(292, '3a15fd8', '949aec4', '3a15fd8', 'Thatâ€™s good to hear. There is one in particular which I will be bring to you soon to discuss and would like to jump on it as soon as possible as there are great growth and cash returns (as calculated thus far). More into to follow later today. ', '2021-01-20 06:55:17', 1),
(293, '3a15fd8', '949aec4', '3a15fd8', 'Hi Ryan, ', '2021-01-20 09:28:35', 1),
(294, '3a15fd8', '949aec4', '3a15fd8', 'Hi Ryan, ', '2021-01-20 09:28:36', 1),
(295, '3a15fd8', '949aec4', '3a15fd8', 'Please see the update in task. property options will follow soon once I have done more due diligence on specific options.', '2021-01-20 09:30:04', 1),
(296, '3a15fd8', '949aec4', '3a15fd8', 'Apologies for the double messaging  :)', '2021-01-20 09:30:22', 1),
(297, '3a15fd8', '3a15fd8', '', 'Thanks for that. Where there supposed to be six locations? There were only five in the PDF. Briefly looking at the locations, I was more drawn to ones like Thorneside QLD which can benefit from its promixity to Brisbane CBD in the longer term. While ones like Mansfield VIC, Iâ€™d need to know more about whatâ€™s in that area and if demand will hold in the longer term once WFH is more balanced. ', '2021-01-20 11:18:00', 1),
(298, '3a15fd8', '3a15fd8', '', 'Also Iâ€™m meeting up with my broker on Friday and he says he is getting final pricing approvals. So should be ready to move if the right one comes through.', '2021-01-20 11:19:30', 1);
INSERT INTO `messages` (`id`, `convid`, `user`, `replyto`, `message`, `inserton`, `red`) VALUES
(299, '3a15fd8', '949aec4', '3a15fd8', 'Hi Ryan, there are many more than 6, weâ€™re only showing the top select in performance of 10%+ growth over 3 and 5 years. So that you know, these locations is where we are searching for the options that will best work on a growth, but also cash return model. I wouldnâ€™t advise discounting locations you may not be familiar with at this stage. Once we find the product in one of these market that will serve you on all account, is when we display said markets driving factors and credentials. These locations have been supplied to us by our economist with data behind them. As to not confuse decision making, we find it best to prove the validation of the market where the best product is found. Itâ€™s a far quicker method and it allows us to get to the options and secure them, without losing them to competition. ', '2021-01-20 11:28:06', 1),
(300, '3a15fd8', '949aec4', '3a15fd8', 'Regarding the brokerage, that sounds good, looking forward to hearing more. ', '2021-01-20 11:28:32', 1),
