(305, '3a15fd8', '3a15fd8', '', 'Yep that makes sense in doing it around the property. Iâ€™d still be open to understanding more about ones which would of have not be my first intuition. Iâ€™ll let you know how I got tomorrow with the broker and how long until finances are good to go. ', '2021-01-21 11:01:25', 1),
(306, '3a15fd8', '949aec4', '3a15fd8', 'Hi Ryan, Iâ€™ve just updated the project. Weâ€™ve found a very good options. Please go through all the information, videos, document links to validate the findings. Even though your not yet formally approved, it would be great to secure an inspection with our team, and so Iâ€™ve booked in an inspection for this Saturday. If its what weâ€™re after then we can be a little crafty around the offer if needed. Once you have gone through everything, please call me back to discuss asap.', '2021-01-21 12:15:42', 1),
(307, '3a15fd8', '949aec4', '3a15fd8', 'tomorrow morining... ', '2021-01-21 12:16:21', 1),
(308, '3a15fd8', '949aec4', '3a15fd8', 'All the updates are inside task 3.', '2021-01-21 12:16:37', 1),
(309, '3a15fd8', '949aec4', '3a15fd8', 'Hi Ryan, I\'ve just spotted an error on the rent and yield in your upload. It\'s not $415, it\'s $700 equaling 6.2%. My apologies mate I\'ll get that corrected soon. ', '2021-01-22 00:41:40', 1),
