(330, '23a224e', '949aec4', '23a224e', 'Hi Zhe,  All fixed and uploaded.  So from here on, we are considering all options in the markets which will be explained in the video. This can take some time but we\'ve already begun early last week.  Once we find the property, our inspection agents will get onto it right away and Iâ€™ll communicate with you what it is that weâ€™ve found and got a green light from you for us to inspect it, there will be a video for this too and it will show you how we expect it to perform based on our reports with John Lindeman. If itâ€™s what weâ€™re looking for and the inspection comes back positively, we then need to make decisions with a little bit of haste. Iâ€™m letting you know this now so that we can get ready for the exciting times ahead ðŸ˜Š', '2021-01-25 03:03:12', 1),
(331, '1a400b3', '949aec4', '1a400b3', 'Hi Rachel and Andrew,  All fixed and uploaded.  So from here on, we are considering all options in the markets which will be explained in the video. This can take some time but we\'ve already begun early last week.  Once we find the property, our inspection agents will get onto it right away and Iâ€™ll communicate with you what it is that weâ€™ve found and got a green light from you for us to inspect it, there will be a video for this too and it will show you how we expect it to perform based on our reports with John Lindeman. If itâ€™s what weâ€™re looking for and the inspection comes back positively, we then need to make decisions with a little bit of haste. Iâ€™m letting you know this now so that we can get ready for the exciting times ahead ðŸ˜Š', '2021-01-25 03:38:46', 1),
