(333, '23a224e', '23a224e', '', 'Hi Darren - thank you for the prompt update. Exiting times ahead! Regarding the video, I clicked on the link on page 3 slide, and it\'s still showing as error page per my last screenshot. I also tried to copy the link and paste it separately to view, same error message. Would you mind to double confirm on this i.e, \'https://www.loom.com/share/75f1b66d2ea743ccab461aa85c954ff6\' . Many thanks', '2021-01-25 11:36:14', 1),
(334, '25a8bf2', '949aec4', '25a8bf2', 'Hi Jinto, welcome to the portal. Weâ€™ll begin the build-out of your project shortly.  Please note, we are rebuilding the portal as an IOS and Android app which will be a lot better to operate once itâ€™s ready, which weâ€™re hoping to have complete in 2 weeks. In the meantime, to create the new one we had to remove a few features from this version. So please help us in being patient while we improve things. Please let me know if you have any questions at all. ', '2021-01-27 05:41:30', 1),
