(1, '2f87093', 'images/projects/7fd7a20481d1b45d3bf3dca2fab9e3749520066a.PNG', '27A Abacore Drive, Corlette', 'ae103a2', 'Brock & Olivia - Full Service Investent Product', '2020-06-01', '<p>Brock and Olivia are in the market for a cashflow positive property with high imminent growth. The key objective is to expand the portfolio withing 6 to 8 months.&nbsp;</p>\r\n', '0000001', '2020-06-26 06:40:04', 'Active'),
(4, '9be0e9f', 'images/projects/1597667177.png', '3/11 Addison Rd', '9fbeb61', 'Tim Walters', '2020-08-17', '<p>Full-Service Ba Acquisition</p>\r\n', '0000001', '2020-08-17 12:23:22', 'Active'),
(5, '95cd176', 'images/projects/1598784703.png', 'Karachi, pakistan', 'de5af28', 'Test Project', '2020-08-30', '<p>Lorem ipsum dolor sit amet&nbsp;Lorem ipsum dolor sit amet&nbsp;Lorem ipsum dolor sit amet&nbsp;Lorem ipsum dolor sit amet&nbsp;Lorem ipsum dolor sit amet&nbsp;</p>\r\n', '0000001', '2020-08-30 10:49:56', 'Active'),
