(8, '71eaf0b', 'images/projects/1601546974.png', '22 King Crown St, Bottany Bay, NSW', '15bfe7e', 'Tim Wallace', '2020-10-01', '<p>Tim has 8 investment properties&nbsp;and is looking to buy number 9. Cashflow is priority so that we can create servicebility from the bank for project number 10 which will be a duplex build.</p>\r\n', '949aec4', '2020-10-01 10:08:35', 'Active'),
(14, 'e03dd7f', 'images/projects/1607657218.png', 'New York 10002', '9d13458', 'Simon & Emma', '2020-12-14', '<h5 segoe=\"\" ui\",=\"\" roboto,=\"\" \"helvetica=\"\" neue\",=\"\" arial,=\"\" \"noto=\"\" sans\",=\"\" sans-serif,=\"\" \"apple=\"\" color=\"\" emoji\",=\"\" \"segoe=\"\" ui=\"\" symbol\",=\"\" emoji\";\"=\"\" symbol\";=\"\" color:=\"\" rgb(52,=\"\" 58,=\"\" 64);\"=\"\" style=\"color: rgb(52, 58, 64); font-family: -apple-system, BlinkMacSystemFont, \">Strat Prop Full-Service Acquisition.</h5><p segoe=\"\" ui\",=\"\" roboto,=\"\" \"helvetica=\"\" neue\",=\"\" arial,=\"\" \"noto=\"\" sans\",=\"\" sans-serif,=\"\" \"apple=\"\" color=\"\" emoji\",=\"\" \"segoe=\"\" ui=\"\" symbol\",=\"\" emoji\";=\"\" margin-bottom:=\"\" 0px=\"\" !important;\"=\"\" style=\"color: rgb(52, 58, 64); font-family: -apple-system, BlinkMacSystemFont, \">Great to see you Emma &amp; Simon! Welcome to your investment portal, your insight into how we\'re finding your perfect investment property.</p>', '0000001', '2020-12-11 03:26:16', 'Active'),
(15, 'dd2cd20', 'images/projects/1607910252.png', '3068', 'b4ac629', 'Caroline Hasdo\'s Portal', '2020-12-14', '<h5 segoe=\"\" ui\",=\"\" roboto,=\"\" \"helvetica=\"\" neue\",=\"\" arial,=\"\" \"noto=\"\" sans\",=\"\" sans-serif,=\"\" \"apple=\"\" color=\"\" emoji\",=\"\" \"segoe=\"\" ui=\"\" symbol\",=\"\" emoji\";\"=\"\" symbol\";=\"\" color:=\"\" rgb(52,=\"\" 58,=\"\" 64);\"=\"\" style=\"color: rgb(52, 58, 64); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;;\">Strat Prop Full-Service Acquisition.</h5><p segoe=\"\" ui\",=\"\" roboto,=\"\" \"helvetica=\"\" neue\",=\"\" arial,=\"\" \"noto=\"\" sans\",=\"\" sans-serif,=\"\" \"apple=\"\" color=\"\" emoji\",=\"\" \"segoe=\"\" ui=\"\" symbol\",=\"\" emoji\";=\"\" margin-bottom:=\"\" 0px=\"\" !important;\"=\"\" style=\"color: rgb(52, 58, 64); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, &quot;Noto Sans&quot;, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;; margin-bottom: 0px !important;\">Great to see you Caroline! Welcome to your investment portal, your insight into how we\'re finding your perfect investment property.</p>', '949aec4', '2020-12-14 01:43:40', 'Active'),
(16, 'ba1f7dd', 'images/projects/1609983008.png', 'Sydney', '3a15fd8', 'Ryan Kelly', '2021-01-04', '<p>Purchase of a medium spec property with a balance of cash flow and growth with a focus on replacing income at 1 property per year.</p>', '949aec4', '2021-01-07 01:21:48', 'Active'),
(17, '27a0258', 'images/projects/1609997161.png', 'Westmeadow, Melbourne VIC', 'e5d9bc6', 'Aaron Gerrard', '2021-01-04', '<p>Arron is approved for $350,000 and has a deposit size of $60,000. Our intention is to create cashflow to release equity from his portfolio and ideally purchase 2 properties within a year.&nbsp;</p>', '949aec4', '2021-01-07 05:24:45', 'Active'),
(18, '44ba803', 'images/projects/1610080366.png', 'Sydney', '23a224e', 'Zhe Cai', '2021-01-08', '<p>Zhe is aiming to purchase 2 properties in the year, in safe markets. Zhe has an investment property which creates $23,400 gross income per year. Our aim is for high growth.</p>', '949aec4', '2021-01-08 04:32:29', 'Active'),
(20, '98d094e', NULL, 'NSW', '1a400b3', 'Rachel and Andrew\'s Investment ', '2021-01-13', '<p>&nbsp;Rachel and Andrew are new investors entering the market with their 1st investment property. Their ideal purchase rate is 1 property per year, to grow wealth and build an asset base.&nbsp;<br></p>', '0000001', '2021-01-13 05:00:30', 'Active'),
(21, '35192fa', NULL, 'Test', '9c6d216', 'Fiverr Gig ', '2021-01-26', '<p>Test</p>', '949aec4', '2021-01-26 00:42:34', 'Active'),
(22, '08ba82a', 'images/projects/1611723985.png', '28 birdsong Avenue mickleham Vic 3064', '25a8bf2', 'Jinto Joseph', '2021-01-20', '<p class=\"MsoNormal\"><span lang=\"EN-AU\" style=\"font-size: 12pt; font-family: &quot;Segoe UI&quot;, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Jinto is looking to purchase high growth strong\r\ncashflow investment property in the range of $350,000 with the serviceability\r\nof $500,000 approved for the lending. Jinto would like frequent updates on the\r\nproject, regardless of action.&nbsp;</span><span lang=\"EN-AU\"><o:p></o:p></span></p>', '949aec4', '2021-01-27 05:05:20', 'Active');
INSERT INTO `tasks` (`id`, `taskno`, `name`, `project`, `description`, `taskupdate`, `updatedate`, `assigned`, `assigndate`, `status`, `inserton`) VALUES
(1, 1, 'Signed Agreement', '2f87093', '<p><span style=\"font-family:Verdana,Geneva,sans-serif\"><span style=\"font-size:16px\"><span style=\"color:#2980b9\"><strong>C O N G R A T U L A T I O N S !</strong></span></span></span></p>\r\n\r\n<p><em>Brock &amp; Olivia thanks for signing on with us!&nbsp;We look forward to this exciting journey with you!</em></p>\r\n\r\n<p>Brock &amp; Olivia have signed 5-month agreement commencing 1 June 2020 and opted for the&nbsp;upfront payment with no&nbsp;retainer.</p>\r\n\r\n<p>Please see supporting documents attached.&nbsp;</p>\r\n', '<p>Funds received on the 23rd and&nbsp;24th May 2020, securing the agreement.&nbsp;</p>\r\n', '2020-06-26', '949aec4', '2020-06-26 02:46:46', 5, '2020-06-26 06:40:04'),
(2, 2, 'Create & Finalise FPS Profile', '2f87093', '<p><strong>Brock &amp; Olivia&#39;s FPS Profile</strong> was completed on&nbsp;<strong>31 May 2020</strong>&nbsp;and hilites several key points which will be heavily considered throughout the project. These points are:</p>\r\n\r\n<ul>\r\n	<li>a maximum acquisition budget of $500,000.00</li>\r\n	<li>to raise equity</li>\r\n	<li>through unmanufactured growth</li>\r\n	<li>relying on market influence</li>\r\n	<li>to reinvest asap</li>\r\n</ul>\r\n\r\n<p>Brock &amp; Olivia are non-emotional buyers who are after the right property. The right property to Brock &amp; Olivia:</p>\r\n\r\n<ul>\r\n	<li>will be located in a high growth pocket</li>\r\n	<li>will ideally be able to return equity for repurchase within 6-8 months</li>\r\n	<li>will be positively geared</li>\r\n	<li>does not need to display options for manufacturing growth</li>\r\n</ul>\r\n\r\n<p>Brock &amp; Olivia are busy making a living and understand the power of intelligent investing. Brock is an avid listener to property podcasts and understand the value and returns property can provide.</p>\r\n', '', '2020-06-26', '949aec4', '2020-06-26 03:03:28', 5, '2020-06-26 06:40:04'),
(3, 3, 'Build-out P.L.A.N', '2f87093', '<p>Structured&nbsp;objectives on Brock &amp; Olivia&#39;s P.L.A.N begun on 24th June, after&nbsp;a lengthy delay&nbsp;on the mortgage approval due to the banks processing time being slowed down during the&nbsp;CoVid&nbsp;pandemic.</p>\r\n\r\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center\"><strong>P</strong></td>\r\n			<td style=\"text-align:center\"><strong>L</strong></td>\r\n			<td style=\"text-align:center\"><strong>A</strong></td>\r\n			<td style=\"text-align:center\"><strong>N</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"text-align:center\"><strong>Power </strong>in the market</td>\r\n			<td style=\"text-align:center\"><strong>Location </strong>of interest</td>\r\n			<td style=\"text-align:center\"><strong>Actions </strong>for growth</td>\r\n			<td style=\"text-align:center\"><strong>Next steps</strong> in the portfolio</td>\r\n		</tr>\r\n		<tr>\r\n			<td>This is your FPS Profile</td>\r\n			<td>\r\n			<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:100%\">\r\n				<tbody>\r\n					<tr>\r\n						<td style=\"text-align:center\">1</td>\r\n					</tr>\r\n					<tr>\r\n						<td style=\"text-align:center\">2</td>\r\n					</tr>\r\n					<tr>\r\n						<td style=\"text-align:center\">3</td>\r\n					</tr>\r\n					<tr>\r\n						<td style=\"text-align:center\">4</td>\r\n					</tr>\r\n					<tr>\r\n						<td style=\"text-align:center\">5</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n\r\n			<p>We are currently seeing 5 possible options. These will be updated as we progress</p>\r\n			</td>\r\n			<td>We are relying on market growth</td>\r\n			<td>The next purchase is intended from the growth of this project</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n', '<p>Economic report received - At first view 6 potential suburbs over 3 states stand out.</p>\r\n\r\n<p>Just received confirmation from the Data team on 5 suburbs. We are working through them at the moment and&nbsp;will have an update of where we are going to be looking over the next few days</p>\r\n\r\n<p>&nbsp;</p>\r\n', '2020-07-10', '949aec4', '2020-06-27 02:03:14', 5, '2020-06-26 06:40:04'),
(4, 4, 'LGA Level Validation', '2f87093', '<p><strong>Here are our current top results for high performing LGS&#39;s for your project:</strong></p>\r\n\r\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<h3><strong>LGA</strong></h3>\r\n			</td>\r\n			<td>\r\n			<h3><strong>Current Target</strong></h3>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Eurobodalla Shire</td>\r\n			<td>Batemans Bay</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Albury</td>\r\n			<td>Thurgoona</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Wodonga</td>\r\n			<td>Baranduda</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Sunshine Coast Region</td>\r\n			<td>Nambour</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Logan City</td>\r\n			<td>Waterford</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Bendigo</td>\r\n			<td>North Bendigo</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '<p>Hi Brock &amp; Olivia,&nbsp;</p>\r\n\r\n<p>There are some good perform options available to us. The attached graphs show the current predictions on market growth, not taking into account many factors such:</p>\r\n\r\n<ul>\r\n	<li>our particular market (2,3,4 etc&nbsp;bed)</li>\r\n	<li>optimal land size</li>\r\n	<li>location of dwelling&nbsp;</li>\r\n	<li>type of dwelling</li>\r\n	<li>positions of surrounding factors</li>\r\n	<li>amenity location</li>\r\n	<li>etc..&nbsp;</li>\r\n</ul>\r\n\r\n<p>In conclusion, all of the 3 chosen options are able to achieve 10% growth in the 1st year, based on selection.&nbsp;</p>\r\n\r\n<p>Let me know if you have any questions.&nbsp;</p>\r\n', '2020-07-02', '949aec4', '2020-06-27 02:03:21', 5, '2020-06-26 06:40:05'),
(5, 5, 'Suburb Level Validation', '2f87093', '<h2>Suburb Level Validation</h2>\r\n\r\n<p>Initial investigations have drawn us closer to Batemans Bay and Nambour. We are basing this information of data which we&#39;ve been able to find which reflects a strong demographic with good potential for development and expansion.&nbsp;</p>\r\n\r\n<p>Understanding how the LGA supports the suburb, matched with the demographic to drive its growth allows us to find data focal points.</p>\r\n\r\n<h2>Overview</h2>\r\n\r\n<ul>\r\n	<li>Our prediction for Nambour houses is based on the fact that Nambour has over 4,000 houses and only 600 units and the demand for houses is rising rapidly.</li>\r\n	<li>Our database shows that the number of house listings is reducing at a higher rate than the number of sales, indicating short term price growth to continue.</li>\r\n	<li>In addition, vendor confidence is high and the number of advertised rental vacancies is falling, due to high rental demand indicating that rents should rise.</li>\r\n	<li>Our longer term price forecast is based on the fact that Nambour is one of the fastest growing locations in Queensland, with an annual population growth rate of over 2%.</li>\r\n	<li>Its location alongside the newly upgraded&nbsp;Bruce Highway makes it accessible for commuters to Brisbane, while its location on the Sunshine Coast hinterland makes it attractive to retirees.</li>\r\n	<li>The town is also the administrative&nbsp;headquarters for the Sunshine Coast Regional Council.</li>\r\n</ul>\r\n', '<p>Our initial thoughts have been placed with Batemans Bay and Nambour. Both have shown good options and support from the demographics.&nbsp;</p>\r\n\r\n<p>In these areas, for the required product we are searching for, the stock seems to be low and is not necessarily displaying all the characteristic we are looking for.&nbsp;</p>\r\n\r\n<p>While we can see the opportunities from past sales, we are not necessarily seeing it at this moment. We have got some (potentially good) option available to us, however before we complete the suburb reports, we are going to also look outside of our initial findings zones to search for other option in the meantime, as a precaution just in case what we are looking at is not necessarily exactly what we&#39;re looking for, or if our current findings which we have are not as positive as we hoped.</p>\r\n\r\n<p>This is only based on that fact that we usually see more stock when we are scanning the markets. This in no way means that what we have found might not be of the quality we want, it is only that we are preparing for a worst-case scenario.&nbsp;</p>\r\n', '2020-07-08', '949aec4', '2020-06-27 02:03:33', 5, '2020-06-26 06:40:05'),
(6, 6, 'Street Level Validation', '2f87093', '<p>Our initial investigations have shown us the areas which display higher levels of affluence. Knowing these areas, allows us to buy property in the hotspots.&nbsp;</p>\r\n', NULL, '2020-07-08', '949aec4', '2020-06-27 02:03:44', 5, '2020-06-26 06:40:05'),
(7, 7, 'Initial Property Selection', '2f87093', '<h2>First Option</h2>\r\n\r\n<p>We have found several options which return strong investment potential Nambour. Our focal area is rated 8.5/10 on an affluence scale.</p>\r\n\r\n<p>Our initial selection (and current 1st) returns good growth and yield potential.&nbsp;</p>\r\n\r\n<p>With assistance from the 2nd dwelling, we are expecting more than 6% yield at approximately $30,000 gross income from the property.</p>\r\n\r\n<p>It is to our&nbsp;<strong>current&nbsp;</strong>understanding that both dwellings are tenanted&nbsp;on a monthly basis, however, have been lodging for over a year.&nbsp;</p>\r\n', NULL, '2020-07-08', '949aec4', '2020-06-27 02:03:53', 5, '2020-06-26 06:40:05'),
(9, 8, 'Initial Property Due Diligence', '2f87093', '<h2>Initial Property Due Diligence</h2>\r\n\r\n<p>Our initial findings have led us to&nbsp;<a href=\"https://www.realestate.com.au/property/8-donaldson-rd-nambour-qld-4560\">https://www.realestate.com.au/property/8-donaldson-rd-nambour-qld-4560</a></p>\r\n\r\n<p>This link here is a very close copy to the property of our focus property and was owned by the same vendor.</p>\r\n\r\n<p><a href=\"https://www.realestate.com.au/property-house-qld-nambour-131049538\">https://www.realestate.com.au/property-house-qld-nambour-131049538</a>&nbsp;show as &quot;for sale&quot; but has had an offer accepted.</p>\r\n\r\n<p>I have attached the property report from RP Data here too so that we can gauge a price comparison with hopes that we can secure this property off-market, we might be able to negotiate the price further down by saving time and marketing campaign fees as well as some other points such as the flood line, which we can discuss on Saturday</p>\r\n', NULL, '2020-07-10', '949aec4', '2020-06-27 02:05:17', 5, '2020-06-26 06:40:05'),
(11, 9, 'Contingency Presentation', '2f87093', '', NULL, '2020-09-01', '949aec4', '2020-06-27 02:05:38', 5, '2020-06-26 06:40:05'),
(12, 10, 'Presentation Approved', '2f87093', '<p>Presentation Approved</p>\r\n', NULL, '2020-07-13', '949aec4', '2020-06-27 02:06:08', 5, '2020-06-26 06:40:05'),
(13, 11, 'Conveyancing', '2f87093', '<h2>Jake Morrison @ Empire&nbsp;Legal Conveyancing</h2>\r\n\r\n<p>The contract and the legal touchpoints have been submitted to out conveyance partners at Warlow Scott.</p>\r\n', NULL, '2020-09-15', '949aec4', '2020-06-27 02:06:23', 5, '2020-06-26 06:40:05'),
(14, 12, 'Pest & Build Inspection', '2f87093', '<h1>Rapid Building Inspection</h1>\r\n\r\n<p>Building and pest inspection are booked and paid for with our trusted partners at Rapid for a fee of $509 for both dwellings.</p>\r\n\r\n<p>Inspection time 3 pm 15th July 2020 in the company of Darren and Keyline real estate.&nbsp;</p>\r\n\r\n<p>Invoice to follow.</p>\r\n', NULL, '2020-08-03', '949aec4', '2020-06-27 02:06:32', 5, '2020-06-26 06:40:05'),
(15, 13, 'Strat Prop Inspection', '2f87093', '<p>Fly and inspection date: 15th July</p>\r\n\r\n<p>Return Flight 16th&nbsp;July</p>\r\n', NULL, '2020-08-03', '949aec4', '2020-06-27 02:06:41', 5, '2020-06-26 06:40:05'),
(16, 14, 'Client Inspection (Optional)', '2f87093', '<p>Complete - Not attending - Agent Inspections only</p>\r\n', NULL, '2020-09-22', '949aec4', '2020-06-27 02:06:53', 3, '2020-06-26 06:40:05'),
(17, 15, 'Negotiation', '2f87093', '<h1>Negotiation Target of $410</h1>\r\n\r\n<p>Negotiation has began with the agent at $400,000 Based on compatible sales.&nbsp;</p>\r\n', NULL, '2020-07-28', '949aec4', '2020-06-27 02:07:00', 5, '2020-06-26 06:40:05'),
(18, 16, 'Transfer of Contract', '2f87093', '<p>Under QLD realestate law, the contract is in our possession for review and proposal.&nbsp;</p>\r\n', NULL, '2020-08-10', '949aec4', '2020-06-27 02:07:10', 5, '2020-06-26 06:40:05'),
(19, 17, 'Overview Settlement', '2f87093', '<h1>Monitor Settlement&nbsp;Process</h1>\r\n\r\n<p>Once settlement is underway, our new management partner Maryaane McGregor of Suncoast Property management has agreed to take on the property management if you so wish, at which stage, this form is to be completed for the onboarding process.</p>\r\n\r\n<p><a href=\"https://documents.realworks.com.au/?api=qld#c84aaee4-6454-45dd-a16d-b7bc57e12f37/14721755\">https://documents.realworks.com.au/?api=qld#c84aaee4-6454-45dd-a16d-b7bc57e12f37/14721755</a></p>\r\n\r\n<p>&nbsp;</p>\r\n', NULL, '2020-09-15', '949aec4', '2020-06-27 02:07:23', 5, '2020-06-26 06:40:05'),
(20, 18, 'Move to Portfolio', '2f87093', '<p>move to portfolio</p>\r\n', NULL, NULL, '949aec4', '2020-06-27 02:07:31', 0, '2020-06-26 06:40:05'),
