(67, 7, 'Initial Property Selection', '9be0e9f', '<p><b>12 Franks Rd</b></p><ul><li>The house is currently tenanted by its vendors who have been living there for 13 years.&nbsp;</li><li><span style=\"font-size: 1rem; -webkit-tap-highlight-color: transparent; -webkit-text-size-adjust: 100%;\">The 3 bedroom home is off market and the vendors are asking $350,000</span></li><li>Our CMA results a value of $375,000</li><li>Our CMA results a rental rate of $470 per week</li></ul><p><br></p>', NULL, '2020-11-30', '949aec4', '2020-08-17 08:23:24', 3, '2020-08-17 12:23:24');
