(81, 1, 'Signed Agreement', '95cd176', '<p><strong>C O N G R A T U L A T I O N S !</strong></p>\r\n\r\n<p><em>_ thanks for signing on with us!&nbsp;We look forward to this exciting journey with you!</em></p>\r\n\r\n<p>_ have signed 5-month agreement commencing 1 June 2020 and opted for _ upfront payment with _ retainer. Strat Prop received the transfer of funds on the 23rd and&nbsp;24th May 2020, securing the agreement.&nbsp;</p>\r\n\r\n<p>Please see supporting documents attached.&nbsp;</p>\r\n', NULL, '2020-09-09', '949aec4', '2020-08-30 06:49:56', 5, '2020-08-30 10:49:56'),
(82, 2, 'Create & Finalise FPS Profile', '95cd176', '<p><strong>Brock &amp; Olivia&#39;s FPS Profile</strong> was completed on&nbsp;<strong>31 May 2020</strong>&nbsp;and hilites several key points which will be heavily considered throughout the project. These points are:</p>\r\n\r\n<ul>\r\n	<li>a maximum acquisition budget of $500,000.00</li>\r\n	<li>to raise equity</li>\r\n	<li>through unmanufactured growth</li>\r\n	<li>relying on market influence</li>\r\n	<li>to reinvest asap</li>\r\n</ul>\r\n\r\n<p>Brock &amp; Olivia are non-emotional buyers who are after the right property. The right property to Brock &amp; Olivia:</p>\r\n\r\n<ul>\r\n	<li>will be located in a high growth pocket</li>\r\n	<li>will ideally be able to return equity for repurchase within 6-8 months</li>\r\n	<li>will be positively geared</li>\r\n	<li>does not need to display options for manufacturing growth</li>\r\n</ul>\r\n\r\n<p>Brock &amp; Olivia are busy making a living and understand the power of intelligent investing. Brock is an avid listener to property podcasts and understand the value and returns property can provide.</p>\r\n', NULL, '2020-09-09', '949aec4', '2020-08-30 06:49:56', 5, '2020-08-30 10:49:56'),
