(101, 1, 'Signed Agreement', 'f1e8c89', '<p><strong>C O N G R A T U L A T I O N S !</strong></p>\r\n\r\n<p><em>Dan thanks for signing on with us!&nbsp;We look forward to this exciting journey with you!</em></p>\r\n\r\n<p>You have signed 6-month agreement commencing 17&nbsp;September 2020 and opted for upfront payment with no retainer.</p>\r\n\r\n<p>Strat Prop received the transfer of funds on the 18th September 2020, securing the agreement.&nbsp;</p>\r\n\r\n<p>Please see supporting documents attached.&nbsp;</p>\r\n', NULL, '2020-09-24', '949aec4', '2020-09-24 04:07:34', 5, '2020-09-24 08:07:34'),
(102, 2, 'Create & Finalise FPS Profile', 'f1e8c89', '<p><strong>Dan&#39;s FPS Profile</strong> was completed on&nbsp;<strong>7th September 2020</strong>&nbsp;and highlights several key points which will be heavily considered throughout the project. These points are:</p>\r\n\r\n<ul>\r\n	<li>a maximum acquisition budget of $&nbsp; ?</li>\r\n	<li>to raise equity</li>\r\n	<li>relying on market influence</li>\r\n	<li>to produce high cashflow</li>\r\n</ul>\r\n\r\n<p>Dan is non-emotional buyers who are after the right property. The right property to Dan:</p>\r\n\r\n<ul>\r\n	<li>will be located in a growth area</li>\r\n	<li>will ideally be able to return equity for repurchase within 3-5 months</li>\r\n	<li>will be positively geared</li>\r\n	<li>does not need to display options for manufacturing growth</li>\r\n</ul>\r\n', NULL, '2020-10-19', '949aec4', '2020-09-24 04:07:35', 5, '2020-09-24 08:07:35'),
(103, 3, 'Build-out P.L.A.N', 'f1e8c89', '<h2>P.L.A.N</h2>\r\n\r\n<p>We are making decisions on your financial position to find a property that can achieve serviceability for future investment.</p>\r\n\r\n<p>After discussions with our mortgage broker partners at Cane Financial, we have taken your pension into account and are confident that we can reach $355,000 loan (currently) for the application of future properties considering we can generate a minimum income of $15,000 net ex GST.</p>\r\n\r\n<p>Once property number 2 is purchased, the strategy will shift to manufactured equity so that we can leverage the capital from the bank. This is because the banks prefer 50% (at max) income to be generated from the property.&nbsp;</p>\r\n\r\n<p><strong>Power&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong>Cash Purchase</p>\r\n\r\n<p><strong>Location&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong>?</p>\r\n\r\n<p><strong>Action&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong>Buy and hold high income</p>\r\n\r\n<p><strong>Next Steps</strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 3 month grace period and then leverage bank load to the highest loan amount on another income-producing asset.</p>\r\n', NULL, '2020-11-24', '949aec4', '2020-09-24 04:07:35', 5, '2020-09-24 08:07:35'),
(104, 4, 'LGA Level Validation', 'f1e8c89', '<h2><strong>LGA Reports Ordered</strong></h2>\r\n\r\n<p>Hi Dan, based on tight markets, I&#39;ve renegades with our economists and have ordered new reporters for LGA (local government areas) to target.</p>\r\n\r\n<h3>Here are our current top results for high performing LGS&#39;s for your project:</h3>\r\n\r\n<ul>\r\n	<li>NSW - Cessnock</li>\r\n	<li>NSW - Muswellbrook</li>\r\n	<li>NSW - Gunnedah Shire</li>\r\n	<li>NSW -&nbsp;Clarence Valley Council</li>\r\n	<li>SA - Whyalla Norrie</li>\r\n	<li>QLD - Kingaroy Shire</li>\r\n	<li>QLD - Lenington</li>\r\n	<li>QLD - Angergrove</li>\r\n	<li>QLD -&nbsp;South Ripley</li>\r\n	<li>QLD - Townsville</li>\r\n</ul>\r\n\r\n<p>We currently have&nbsp;favourites:</p>\r\n\r\n<ol>\r\n	<li>Muswellbrook</li>\r\n	<li>Townsville</li>\r\n</ol>\r\n', NULL, '2020-11-04', '949aec4', '2020-09-24 04:07:35', 5, '2020-09-24 08:07:35'),
(105, 5, 'Suburb Level Validation', 'f1e8c89', '<h2>Suburb Selection</h2>\r\n\r\n<p>Attached are initial property selections based on the location of the dwelling for the return of interest.&nbsp;</p>\r\n\r\n<p>One very important factor is ensuring that the property we select is in the correct location within the suburb. While some of the attached are not&nbsp;options (due to return or availability), the positions of these are favourable.</p>\r\n', NULL, '2020-11-24', '949aec4', '2020-09-24 04:07:35', 5, '2020-09-24 08:07:35'),
