(145, 5, 'Suburb Level Validation', '71eaf0b', '<p>Hi Brock &amp; Olivia,&nbsp;</p>\r\n\r\n<p>There are some good perform options available to us. The attached graphs show the current predictions on market growth, not taking into account many factors such:</p>\r\n\r\n<ul>\r\n	<li>our particular market (2,3,4 etc&nbsp;bed)</li>\r\n	<li>optimal land size</li>\r\n	<li>location of dwelling&nbsp;</li>\r\n	<li>type of dwelling</li>\r\n	<li>positions of surrounding factors</li>\r\n	<li>amenity location</li>\r\n	<li>etc..&nbsp;</li>\r\n</ul>\r\n\r\n<p>In conclusion, all of the 3 chosen options are able to achieve 10% growth in the 1st year, based on selection.&nbsp;</p>\r\n\r\n<p>Let me know if you have any questions.&nbsp;</p>\r\n', NULL, '2020-11-19', '949aec4', '2020-10-01 06:08:35', 3, '2020-10-01 10:08:35'),
