INSERT INTO `taskupdates` (`id`, `taskupdate`, `task`, `project`, `insertby`, `inserton`) VALUES
(2, '<p>test this is test update</p>\r\n', 41, 'fc0cd5c', '0000001', '2020-07-07 21:40:25'),
(3, '<p>Funds received on the 23rd and&nbsp;24th May 2020, securing the agreement.&nbsp;</p>\r\n', 1, '2f87093', '949aec4', '2020-07-07 23:06:57'),
(4, '<p>Economic report received - At first view 6 potential suburbs over 3 states stand out.</p>\r\n\r\n<p>Just received confirmation from the Data team on 5 suburbs. We are working through them at the moment and&nbsp;will have an update of where we are going to be looking over the next few days</p>\r\n\r\n<p>&nbsp;</p>\r\n', 3, '2f87093', '949aec4', '2020-07-07 23:06:57'),
(5, '<p>Hi Brock &amp; Olivia,&nbsp;</p>\r\n\r\n<p>There are some good perform options available to us. The attached graphs show the current predictions on market growth, not taking into account many factors such:</p>\r\n\r\n<ul>\r\n	<li>our particular market (2,3,4 etc&nbsp;bed)</li>\r\n	<li>optimal land size</li>\r\n	<li>location of dwelling&nbsp;</li>\r\n	<li>type of dwelling</li>\r\n	<li>positions of surrounding factors</li>\r\n	<li>amenity location</li>\r\n	<li>etc..&nbsp;</li>\r\n</ul>\r\n\r\n<p>In conclusion, all of the 3 chosen options are able to achieve 10% growth in the 1st year, based on selection.&nbsp;</p>\r\n\r\n<p>Let me know if you have any questions.&nbsp;</p>\r\n', 4, '2f87093', '949aec4', '2020-07-07 23:06:57'),
(6, '<p>Our initial thoughts have been placed with Batemans Bay and Nambour. Both have shown good options and support from the demographics.&nbsp;</p>\r\n\r\n<p>In these areas, for the required product we are searching for, the stock seems to be low and is not necessarily displaying all the characteristic we are looking for.&nbsp;</p>\r\n\r\n<p>While we can see the opportunities from past sales, we are not necessarily seeing it at this moment. We have got some (potentially good) option available to us, however before we complete the suburb reports, we are going to also look outside of our initial findings zones to search for other option in the meantime, as a precaution just in case what we are looking at is not necessarily exactly what we&#39;re looking for, or if our current findings which we have are not as positive as we hoped.</p>\r\n\r\n<p>This is only based on that fact that we usually see more stock when we are scanning the markets. This in no way means that what we have found might not be of the quality we want, it is only that we are preparing for a worst-case scenario.&nbsp;</p>\r\n', 5, '2f87093', '949aec4', '2020-07-07 23:06:57'),
(7, '<p>sadawdawd</p>\r\n', 41, 'fc0cd5c', '0000001', '2020-07-07 23:21:08'),
(8, '<p>sadawdawd</p>\r\n', 41, 'fc0cd5c', '0000001', '2020-07-07 23:22:15'),
(9, '<p>sadawdawd</p>\r\n', 41, 'fc0cd5c', '0000001', '2020-07-07 23:22:28'),
(10, '<p>asdaw</p>\r\n', 41, 'fc0cd5c', '0000001', '2020-07-07 23:24:12'),
(11, '<p>asdaw</p>\r\n', 41, 'fc0cd5c', '0000001', '2020-07-07 23:25:06'),
(12, '<p>saxasxasxas</p>\r\n', 41, 'fc0cd5c', '0000001', '2020-07-07 23:26:34'),
(13, '<p>saasdawadawd</p>\r\n', 41, 'fc0cd5c', '0000001', '2020-07-07 23:29:07'),
(14, '<p>awddaw wa dawd&nbsp;</p>\r\n', 41, 'fc0cd5c', '0000001', '2020-07-07 23:31:25'),
(15, '<p>as ss a sa&nbsp;</p>\r\n', 41, 'fc0cd5c', '0000001', '2020-07-08 00:03:48'),
(16, '<p>This is test</p>\r\n', 41, 'fc0cd5c', '0000001', '2020-07-08 00:09:05'),
(17, '<p>dwadawdawdaw</p>\r\n', 41, 'fc0cd5c', '0000001', '2020-07-08 00:09:39'),
(18, '<p>This&nbsp; is the the test</p>\r\n', 43, 'fc0cd5c', '0000001', '2020-07-08 00:12:07'),
(22, '<ol>\r\n	<li>Please note, we are seeking clarity on the properties expected price range. Our initial approach was to find a negotiable property and win off the gain of that.&nbsp; This property, however, has an option for income and therefore feel that this is where we add to the strength of the property.&nbsp;</li>\r\n	<li>The property also has an easement&nbsp;on it. This is not government&nbsp;placed but is, in fact, a 100-year flood line. This means insurances need to to be weighed up</li>\r\n</ol>\r\n', 9, '2f87093', '949aec4', '2020-07-08 12:52:24'),
(23, '<p>The heatmap below shows the most affluent areas in darker blue.&nbsp;</p>\r\n', 6, '2f87093', '949aec4', '2020-07-08 13:00:37'),
(24, '<p><a href=\"https://www.realestate.com.au/property/8-donaldson-rd-nambour-qld-4560\">https://www.realestate.com.au/property/8-donaldson-rd-nambour-qld-4560</a></p>\r\n', 7, '2f87093', '949aec4', '2020-07-08 13:01:56'),
(25, '<p>Due diligence reports will be returned within 1 working day form 10 July 2020 - 3:35pm</p>\r\n', 13, '2f87093', '949aec4', '2020-07-10 06:39:20'),
(26, '<p>Contingency Presentation for 8 Donaldson Rd Nambour attached awaiting presentation&nbsp;</p>\r\n', 11, '2f87093', '949aec4', '2020-07-10 09:09:32'),
(27, '<p>Presentation scheduled for 7am Saturday 11 July 2020</p>\r\n', 11, '2f87093', '949aec4', '2020-07-10 20:46:23'),
(28, '<p>Hi team, the contract is still with me. I need to check one last thing before submitting it to the agent&nbsp;which is the cont for the easement on the premiums. I&#39;m 90% sure we are withing budget well well, but I need to be 100% as it&#39;s binding if they accept it.&nbsp;</p>\r\n', 18, '2f87093', '949aec4', '2020-07-13 11:45:35'),
(29, '<p>Additionally, I have spoken with the agent about the marketing campaign and there have been no enquiries as they haven&#39;t begun it, nor&nbsp;planned for it, so please don&#39;t worry about timing, we are still looking very much on top of things in terms of first to market.</p>\r\n', 18, '2f87093', '949aec4', '2020-07-13 11:48:42'),
(31, '<p>Good morning team, the points I was waiting on to use in the negotiation are not strong enough (in actuality), however I&#39;ve kept them as a concern in the negotiation and began at $400,000. I&#39;ve expressed a ceiling of $406,000 after agent negotiations and this is now being put forward to the vendor.&nbsp;</p>\r\n\r\n<p>Presuming&nbsp;we are accepted on the offer, the 3.1% saving comes&nbsp;to $13,000 under asking.&nbsp;</p>\r\n', 17, '2f87093', '949aec4', '2020-07-14 00:48:47'),
(32, '<p>Hi team, I&#39;ve just heard back from the agent and our offer of $406,000 has been accepted.&nbsp;</p>\r\n', 17, '2f87093', '949aec4', '2020-07-14 03:06:36'),
(33, '<p>Notes from Anite for Andrew (See Attachment 1-3S69KQ4 Product Comparison Report):</p>\r\n\r\n<ul>\r\n	<li>$406k&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Purchase price</li>\r\n	<li>$12635&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Stamp duty</li>\r\n	<li>$2k&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Legal fees including searches (approx. only)</li>\r\n	<li>$2k&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Other costs (approx. only to cover settlement fee, registration of mortgage , insurance, adjustment of rates/water and other small costs associated with the purchase)</li>\r\n	<li>$1020&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; QLD transfer fee</li>\r\n	<li>$423655&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Total</li>\r\n	<li>$324800&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Loan amount (80% of purchase price to avoid LMI)</li>\r\n	<li>$99k&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; approx. client contribution (this may be slightly more than needed as the &ldquo;other costs&rdquo; might be a little over the exact figure but I would rather be over than under)</li>\r\n</ul>\r\n', 13, '2f87093', '949aec4', '2020-07-14 06:11:29'),
(34, '<h2>Rapid P&amp;B complete.</h2>\r\n\r\n<p>Trades needed for repair work. Vendor has tentatively agreed to pay for charges involved in the repairs. See attached&nbsp;</p>\r\n', 14, '2f87093', '949aec4', '2020-07-16 02:33:06'),
(35, '<p>Builder has been booked and will quote on repairs in the coming days. The real estate agent has agreed to allow access to Mark Turner (Builder) to asses, quote and repair the water damaged areas.&nbsp;<br />\r\n&nbsp;</p>\r\n\r\n<p>Marryanne McGregor (new management recommendation) has been interview and approved my myself. Marryanne will send needs the introduction and rates agreement to me to forward onto you both to review and approve if found to your liking. Maryanne happens to also be South African (unplanned haha) however have a decent rentroll operations md reputation in and around Nambour and Maroochydore.&nbsp;</p>\r\n', 15, '2f87093', '949aec4', '2020-07-16 07:46:41'),
(36, '<p><strong>Hi team, please see the email below where I have updated the sales agent and builder for repairs&nbsp;</strong></p>\r\n\r\n<p>Hi Andrew,&nbsp;</p>\r\n\r\n<p>I spoke with Mark yesterday evening and he seems on top of things.</p>\r\n\r\n<p>Mark and Andrew please could you guys communicate for access to the property&nbsp;<a href=\"x-apple-data-detectors://1\">on Monday morning</a>&nbsp;(or after) to sight and quote the work needed?&nbsp;</p>\r\n\r\n<p>Mark, once you&rsquo;ve provided the quote&nbsp; we can get underway with the repairs. My clients have requested the work if approved by our building inspectors (Warren from Rapid) after the work is done. I hope you guys understand that is just a formality and ill chat with Warren to make sure the intention is understood.</p>\r\n\r\n<p>So that we&rsquo;re all on the same page Andrew, there are 4 points to action please:&nbsp;</p>\r\n\r\n<ol>\r\n	<li>Main house front porch waterproofing and support below</li>\r\n	<li>Main house ceiling leak at kitchen/living room to be fixed and have a manhole&nbsp;</li>\r\n	<li>Granny flat shower leak inside</li>\r\n	<li>Granny flat framing to be cleaned and painted</li>\r\n</ol>\r\n\r\n<p>Thank you gentlemen for your cooperation.&nbsp;</p>\r\n\r\n<p>Kindest,</p>\r\n', 15, '2f87093', '949aec4', '2020-07-17 06:07:22'),
(37, '<p>Hi guys, the builders are onsite&nbsp;tomorrow to quote the work needed and&nbsp;will follow with a quote in a couple days. Once we have that amount we can negotiate this off the property as agreed by the vendors. At that stage the contract will undergo conveyancing with those terms and settle the purchase. Once the property is settled, the work can then be carried out on the property in your ownership.&nbsp;</p>\r\n', 14, '2f87093', '949aec4', '2020-07-20 00:32:06'),
(38, '<p>We have secured the negosiationnat $390,000 from the vendor and are finalising the contract and purchase order&nbsp;</p>\r\n', 17, '2f87093', '949aec4', '2020-07-28 12:33:18'),
(39, '<p>Hi team,&nbsp;</p>\r\n\r\n<p>We have moved&nbsp;our&nbsp;conveyance from our original partner at Warlow Scott to Empire Legal. Due to slow response.&nbsp;</p>\r\n', 13, '2f87093', '949aec4', '2020-07-28 12:35:55'),
(40, '<p>The contract is with the vendors legal team currently. We&#39;re are expecting to recieve&nbsp;it back today.&nbsp;</p>\r\n', 13, '2f87093', '949aec4', '2020-08-02 22:25:58'),
(41, '<p>Conveyancing underway with new partners at Empire&nbsp;Legal&nbsp;</p>\r\n\r\n<p>Brock and Olivia, please attach you&#39;re completed from s from today&#39;s email, or CC me on the email when returning so that I may upload them to the portal.&nbsp;</p>\r\n', 13, '2f87093', '949aec4', '2020-08-11 07:03:14'),
(42, '<p>Confirmation of finance Clause sent to Griffiths Parry from Empire Legal - Attached PDF</p>\r\n', 13, '2f87093', '949aec4', '2020-08-13 07:56:26'),
(43, '<p>Contract Exchanged and in conveyancing with Jake at Empire Legal&nbsp;</p>\r\n', 18, '2f87093', '949aec4', '2020-08-13 07:59:00'),
(44, '<p>Loan application from the banks has been waved. Our strategy is to create an income so that subsequent purchases can be financed by lending institutions.&nbsp;</p>\r\n\r\n<p>We will be progressing with a cash purchase to rais&nbsp;an income from the property of $21,000 +&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Ideal budget - $300k - $320K</li>\r\n	<li>Ideal Renatal Rate - $400+</li>\r\n</ul>\r\n\r\n<p>PRIORITY - To create a combined income of minumum $70,000 P/A</p>\r\n\r\n<p>&nbsp;</p>\r\n', 102, 'f1e8c89', '949aec4', '2020-10-19 03:05:37'),
(46, '<p>Discussion Craig at Cane Fiancial 2:30pm 20 October highlightd he above.&nbsp;</p>\r\n', 103, 'f1e8c89', '949aec4', '2020-10-20 04:23:52'),
(48, '<p><em>Hi Dan,&nbsp;</em></p>\r\n\r\n<p><em>26 Blanch Parade Grafton details Below:</em></p>\r\n\r\n<h2>Property Description</h2>\r\n\r\n<p>HUGE HOME - DUAL LIVING POTENTIAL - OFFERS WANTED</p>\r\n\r\n<p>26 Blanch Parade South Grafton is a property the lends itself to an extremely broad spectrum of buyers. Our seller has called us in to get the job done. Please disregard all previous advertised prices. We want to hear from the market in order to sell! Make your offers!</p>\r\n\r\n<p>The home has an extremely practical floor-plan with multiple bedrooms upstairs and a &#39;granny flat&#39; style lower level that is ideal for independent living for a teenager or a guest. There is an abundance of space for even the largest of families.</p>\r\n\r\n<p>The property is currently rented for $590 p/w furnished - investors you are extremely well catered for here.</p>\r\n\r\n<p>The proximity of this home in relation to schools, shops and transport are all added bonuses. Multiple outdoor living areas give ample space for entertaining or relaxation. A 5kw solar system is in place assisting with the rising cost of electricity.</p>\r\n\r\n<p>All of the furniture will be included in the sale of the property.</p>\r\n', 107, 'f1e8c89', '949aec4', '2020-11-10 01:28:20'),
(49, '<p>https://grafton.eldersrealestate.com.au/residential/sale/26-blanch-parade-south-grafton-nsw-2460-20872468/</p>\r\n', 107, 'f1e8c89', '949aec4', '2020-11-10 01:29:23'),
(50, '<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>will be located in a growth area</li>\r\n	<li>will ideally be able to return equity for repurchase within 3-5 months</li>\r\n	<li>will be positively geared</li>\r\n	<li>does not need to display options for manufacturing growth</li>\r\n</ul>\r\n', 65, '9be0e9f', '949aec4', '2020-11-19 12:02:58'),
(52, '<p><a href=\"https://www.dropbox.com/s/9vwnh8v4s2m6wd0/1767%20-%20Building%20Report.pdf?dl=0\">Click here for&nbsp;Building Report</a></p>\r\n', 110, 'f1e8c89', '949aec4', '2020-11-19 22:48:47'),
(54, '<p><a href=\"https://www.dropbox.com/s/r6yjqu0s9rzgx9g/Property_Report_138_West_Street_Allenstown_QLD_4700_20-11-2020.PDF?dl=0\">Click here for Property Report</a></p>\r\n\r\n<p><a href=\"https://www.dropbox.com/s/ne8ppjmw9h9uh6o/suburb_statistics_report.pdf?dl=0\">Click here for Allenstown Report</a></p>\r\n\r\n<p>&nbsp;</p>\r\n', 110, 'f1e8c89', '949aec4', '2020-11-19 22:57:22'),
(55, '<p><a href=\"https://my.matterport.com/show/?m=vg1W786YHVU\">Click here for a virtual tour</a></p>\r\n', 110, 'f1e8c89', '949aec4', '2020-11-23 02:33:57'),
(56, '<p>Hi Dan,&nbsp;</p>\r\n\r\n<p>Wes (the agent) will be giving us a walkthrough video in the next day or 2. They need to give the tenants 24 hours notice prior.&nbsp;I asked about the listing time and the 2 agencies did merge but that wasn&#39;t the reason for the long DOM, but rather that the vendor wasn&#39;t negotiating at all.&nbsp;</p>\r\n\r\n<p>The market is on a very stale movement with slight rises and falls, which has probably been the reason for sitting so long. This would need to be considered when we make our offer because if we want to place this property on the market, similar sales time frames might apply. However, the markets will eventually turn and if you don&#39;t sell in a falling market, you essentially haven&#39;t lost anything and so as long as we&#39;re seeing a return then the property is doing its job.&nbsp;</p>\r\n\r\n<p>Chat soon.&nbsp;</p>\r\n', 110, 'f1e8c89', '949aec4', '2020-11-23 02:55:42'),
(57, '<p>Thanks </p><p>thats better</p>', 68, '9be0e9f', '949aec4', '2020-11-23 21:24:53'),
(59, '<p>Property Unfavoured</p>', 107, 'f1e8c89', '949aec4', '2020-11-24 09:55:57'),
