(74, '<p>Hi Dan,&nbsp;</p><p>I have attached the quote for the roof repair which comes to $12,423.40 which includes:</p><ul><li>All Scaffolding</li><li>Removal and replacement of solar panels</li><li>Replacing the strapping and battons</li><li>Replacing new iron sheet roofing.</li></ul><p>He does not see the waterproofing needing to be replaced at this stage and so has not included it in the quote.&nbsp;</p><p>We have also had the builder in today to look at the subfloor and has passed it as a secure foundation and nothing to worry about with the condition they are in. Aaron from AF Construction will be confirming this over email later today.&nbsp;</p>', 110, 'f1e8c89', '949aec4', '2020-12-03 06:15:03'),
(75, '<p>Hi Dan,&nbsp;</p><p>AF Construction (Aaron Flanagan) mate it to sight yesterday for the inspections and has reported that structure is sound and not in need of any attention at this stage. I have uploaded the building report for your reference. His phone number is on the PDF if you wish to contact him directly.&nbsp;</p>', 110, 'f1e8c89', '949aec4', '2020-12-04 05:52:34'),
(76, '<p>Property inspection videos below:</p><p><a href=\"https://my.matterport.com/show/?m=vg1W786YHVU\" style=\"background-color: rgb(255, 255, 255); font-size: 15.2px;\">Click here for a virtual tour</a></p><p><a href=\"https://www.dropbox.com/sh/vvkll3vd2vi07xr/AAChVr4oouKWTrnUig_0Jh5_a?dl=0\" target=\"_blank\" style=\"background-color: rgb(255, 255, 255); font-size: 1rem;\"><span style=\"font-size: 11.5pt; font-family: &quot;Segoe UI&quot;, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Dropbox Link for videos</span></a></p><p><br></p>', 115, 'f1e8c89', '949aec4', '2020-12-04 05:57:11'),
