(78, '<p>Hi Dan,&nbsp;</p><p>I have run the numbers again and they are correct at the NET return.&nbsp;</p><p>The council rates and the insurance come to more than $10,000, which kicks things up substantially as you will require public liability and landlord insurance, supposed to just landlord insurance (or at least I advise this). This is the case for the current owner too.&nbsp;</p><p>I have also attached an example for Muswellbrook so that you can compare.</p><p>With all said and done, this is still an asset which can produce a quick start to a strong portfolio.&nbsp; Some attention might be required, but the rewards for portfolio growth (in my opinion) outweigh any hassles I would think to consider.&nbsp;</p><p>At the end of the day, it\'s your decision and I\'ll work by your will. </p><p>Let\'s chat tomorrow.</p><p>Have a great evening</p>', 110, 'f1e8c89', '949aec4', '2020-12-07 09:19:21');
