(86, 'Hi Caroline, \r\n<br>\r\nThank you for completing the questionnaire. Since receiving this submission and discussing your priorities with you, the below points are what we see as your main priorities. If you would like to add anything to this, please let me know in the chat section and we\'ll edit accordingly. <br>\r\nâ€¢	$400K- $450K budget (purchase can be less if returns make sense)<br>\r\nâ€¢	Depreciation considered pending property value<br>\r\nâ€¢	Extractable equity within a year to repurpose <br>\r\nâ€¢	Conservative risk at 1 property per year<br>\r\nâ€¢	Frequent updates on the project<br>\r\nâ€¢	Buy and hold strategy<br>\r\nâ€¢	Positive cashflow<br>', 241, 'ecc5949', '949aec4', '2020-12-13 23:58:43'),
