(88, 'Hi Caroline, <br>\r\nWe have placed your locations report with our economist. <br>\r\nWe should have our list of locations in the next 2 days, at which stage Initial Property Options and Validation can begin. ', 243, 'ecc5949', '949aec4', '2020-12-14 00:07:59'),
(89, 'Hi Caroline,\r\nThank you for completing the questionnaire. Since receiving this submission and discussing your priorities with you, the below points are what we see as your main priorities. If you would like to add anything to this, please let me know in the chat section and we\'ll edit accordingly. <br>\r\nâ€¢ $400K- $450K budget (purchase can be less if returns make sense)<br>\r\nâ€¢ Depreciation considered pending property value<br>\r\nâ€¢ Extractable equity within a year to repurpose<br>\r\nâ€¢ Conservative risk at 1 property per year<br>\r\nâ€¢ Frequent updates on the project<br>\r\nâ€¢ Buy and hold strategy<br>\r\nâ€¢ Positive cashflow', 266, 'dd2cd20', '949aec4', '2020-12-14 01:45:14'),
(90, 'Hi Caroline,<br>\r\nWe\'re currently waiting on the final confirmed deposit amount form Al.<br>\r\nOnce we know this we\'ll enter into firm negotiations.<br>\r\nUntil then, all other operations can continue', 267, 'dd2cd20', '949aec4', '2020-12-14 01:47:01'),
(91, 'Hi Caroline,<br>\r\nWe\'re currently waiting on the final confirmed deposit amount form Al.<br>\r\nOnce we know this we\'ll enter into firm negotiations.<br>\r\nUntil then, all other operations can continue.<br>', 268, 'dd2cd20', '949aec4', '2020-12-14 01:48:02'),
(92, 'Hi Simon and Emma, thank you for completing the questionnaire. <br>\r\n<br>\r\nSince receiving this submission and discussing your priorities with you, the below points are what we see as your main priorities. <br>\r\nIf you would like to add anything to this, please let me know in the chat section and we\'ll edit accordingly. <br>\r\n<br>\r\n<br>\r\nâ€¢ $400K max budget (purchase can be less if returns make sense) <br>\r\nâ€¢ Depreciation considered pending property value<br>\r\nâ€¢ Extractable equity within a year to repurpose<br>\r\nâ€¢ Conservative risk at 1 property per year<br>\r\nâ€¢ Updates when required on the project<br>\r\nâ€¢ Buy and hold strategy<br>\r\n', 254, 'e03dd7f', '949aec4', '2020-12-14 05:16:07');
