(122, '<p>Hi Ryan,&nbsp;</p><p>Please have a look at the 2 breakdowns explained in this video.&nbsp;</p><p>There are pros and cons to each scenario, I just wanted to make you aware of the options you have with the funds you have available and allow you to make the decision based on your goals.&nbsp;</p><p>https://www.loom.com/share/df44d85850894411bfe303fa105a9ca7<br></p>', 279, 'ba1f7dd', '949aec4', '2021-01-13 01:58:17'),
(124, '<ul style=\"color: rgb(52, 58, 64); font-size: 15.2px;\"><li>$125,000 max deposit available</li><li>$400,000 to $420,000 buy range&nbsp; &nbsp; &nbsp;</li><li>Purchase Goal - 1 to 2 properties per year</li><li>A young keen couple looking to build a future of options</li></ul>', 326, '98d094e', '949aec4', '2021-01-14 03:28:31'),
(125, '<p><b>Investment Discovery Plan</b></p><p>Our market selections has been uploaded below in the PDF below. In this upload, we are showcasing our top 6 location, all with very strong market driving indicators. The majority of these locations are in ideal buying markets with the upturns on the horizon.&nbsp; The selected markets all show signs of a minimum of 10% growth over the year, due to seachange demand and private sector interests which is creating employment and increasing affluence levels. Indicative vacancy rates will result in market shift over the coming month, some sooner than others.&nbsp;<br></p>', 280, 'ba1f7dd', '949aec4', '2021-01-20 09:28:29'),
(126, '<p>Hi Ryan,&nbsp;</p><p>We\'ve found a property from out alerts setup in your profile which would be an very good options. Please go though the upload below to understand more.</p>', 281, 'ba1f7dd', '949aec4', '2021-01-21 12:14:35'),
(127, '<p><span style=\"color: rgb(52, 58, 64); font-size: 15.2px;\">Our market selections have been uploaded below in the PDF below. In this upload, we are showcasing our top 6 location, all with very strong market driving indicators. The majority of these locations are in ideal buying markets with the upturns on the horizon.&nbsp; The selected markets all show signs of a minimum of 10% growth over the year, due to seachange demand and private sector interests which is creating employment and increasing affluence levels. Indicative vacancy rates will result in market shift over the coming month, some sooner than others.&nbsp;</span><br></p>', 304, '44ba803', '949aec4', '2021-01-22 07:14:57'),
(128, '<p><span style=\"color: rgb(52, 58, 64); font-size: 15.2px;\">Our market selections have been uploaded below in the PDF below. In this upload, we are showcasing our top 6 location, all with very strong market driving indicators. The majority of these locations are in ideal buying markets with the upturns on the horizon.&nbsp; The selected markets all show signs of a minimum of 10% growth over the year, due to seachange demand and private sector interests which is creating employment and increasing affluence levels. Indicative vacancy rates will result in market shift over the coming month, some sooner than others.&nbsp;</span><br></p>', 328, '98d094e', '949aec4', '2021-01-22 07:15:16'),
(129, '<p>Hi Ryan, please see below updated property validation and location validation. Samara inspected the property on Saturday 23 January 2021 and has supplied images and videos with commentary of the duplex and the suburbs. Overall I am very happy with the gentrification going on in the area, and Samara has confirmed our original thoughts.</p><p><br></p><p>The property market here is already in swing and on the rise with tightening vacancy rates continuing. This property will not only return fantastic yields once the current leases expire (currently at 5.4% and can rise to 6.4% - 6.6% Samara believes ), but the growth in the area is expected to continue for many years to come.&nbsp;</p><p><br></p><p>Next steps involved getting the pest and Building on the property and placing a conditional offer as we haven\'t got finance yet approved, however, we need your approval on that before doing so. </p><p><br></p><p>Please could you give me a ring if you have any concerns or want to chat about any of the videos and images from the inspection.&nbsp;</p><p><br></p><p>At this stage, it would be beneficial to operate with some haste if you would like to proceed, as there was a fair amount of feet through the door on the day.&nbsp;</p>', 282, 'ba1f7dd', '949aec4', '2021-01-25 01:09:29'),
(130, '<p>www.stratprop.com.au</p>', 61, '9be0e9f', '949aec4', '2021-01-27 03:12:46'),
(131, '<p>www.stratprop.com.au</p>', 72, '9be0e9f', '949aec4', '2021-01-27 03:14:08'),
(132, '<ul><li>Deposit - $90,000</li><li>Approved for $500,000</li><li>Target Purchase Price $350,000 - $370,000</li></ul>', 351, '08ba82a', '949aec4', '2021-01-27 05:57:21');
