INSERT INTO `webpages` (`id`, `name`, `heading`, `data`) VALUES
(1, 'Tax', 'Tax Preparation Checklist', '<p>Tax season can be very challenging especially when it comes to gathering all your documents to complete your tax return.&nbsp; Fortunately, we created this checklist to help you be prepared from the start.&nbsp; Please note not all items will be applicable to you.</p>\r\n\r\n<p><strong>Personal Information</strong></p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->Copies of state identification (front &amp; back) for you and your spouse</p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->Date of birth for all individuals on return</p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->Social Security numbers for all individuals on return</p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->Copies of last year&rsquo;s tax return</p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->Bank Account number and routing number if depositing refund directly to account</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Gross Income</strong></p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->W-2 forms</p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->1099-Misc forms (independent contract work)</p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->1099-INT (interest income)</p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->1099-DIV, 1099B, K-1 (investments &amp; capital gain)</p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->Business income &amp; expense</p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->Rental property income &amp; expense</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Deductions and Credits</strong></p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->1098-T (college tuition)</p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->1098-E (student loan interest)</p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->IRA contributions (retirement plan)</p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->Child care costs</p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->Self-employed health insurance</p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->1098 (mortgage interest)</p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->1098 (property tax payment)</p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->Charitable donations</p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->Medical and dental expense</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n'),
(2, 'Immigration', 'Immigration Documents Checklist', '<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>i130</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>PETITIONER<span dir=\"RTL\">&#39;S INFORMATION</span></p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->The petitioner is the U.S. citizen or lawful permanent resident who is filing the petition. The petitioner preparing Form I-130 will need to provide details about:</p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->Address history for the past five years</p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->Dates previous marriage(s) ended (if applicable)</p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->Employment history for the past five years</p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->Previously filed petition for the beneficiary or any other foreign national</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>BENEFICIARY<span dir=\"RTL\">&#39;S INFORMATION</span></p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->The beneficiary is the intending immigrant that wants to obtain a green card. The beneficiary will need to provide details about:</p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->Address history for the past five years</p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->Dates previous marriage(s) ended (if applicable)</p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->Employment history for the past five years</p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->I-94 information (if presently in the U.S.)</p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->Any previous immigration proceedings</p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->USCIS FILING FEE</p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->COVER LETTER (OPTIONAL)</p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->FORM I-130, PETITION FOR ALIEN RELATIVE</p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->FORM I-130A, SUPPLEMENTAL INFORMATION FOR SPOUSE BENEFICIARY (if spouse is in USA)</p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->PROOF OF STATUS</p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->U.S. citizen - a photocopy of a birth certificate (if U.S. born), passport, naturalization certificate, certificate of citizenship, or consular report of birth abroad.</p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->Permanent resident - photocopy of both sides of your green card or other proof of permanent residence.</p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->MARRIAGE CERTIFICATE</p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->PROOF OF PREVIOUS MARRIAGES TERMINATED (if either you or spouse was married before)</p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->PASSPORT PHOTOS</p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->EVIDENCE OF A BONA FIDE MARRIAGE (depends on situation)</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>N400</p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->Copy (front and back) of your&nbsp;<a href=\"https://www.boundless.com/immigration-resources/the-green-card-explained/\">green card</a>&nbsp;(officially called the&nbsp;Permanent Resident Card, or Form I-551)</p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->Application fee payment (below are the options to pay)</p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->Personal check (with your A-Number printed on the back)</p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->Money order (with your A-Number printed on the back)</p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->Credit card authorization form (<a href=\"https://www.boundless.com/immigration-resources/form-g-1145-explained/\">Form G-1450</a>, officially called the <span dir=\"RTL\">e</span>-Notification of Application/Petition Acceptance)</p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->Proof of current marital status&nbsp;<br />\r\nSend copies of&nbsp;all&nbsp;of the following, if applicable:</p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->Marriage certificates</p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->Divorce papers</p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->Annulment certificates</p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->Death certificates</p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->Other official records (such as a&nbsp;Single Status Certificate or&nbsp;No Record of Marriage Certificate, available from clerks/deputy clerks offices or the&nbsp;Secretary of State<span dir=\"RTL\"><span dir=\"RTL\">&#39;s Apostille office</span></span>&nbsp;in each state)</p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->Identify</p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->Two&nbsp;passport-style photos (2 inches by 2 inches)</p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->Military service if applicable</p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->Form N-426&nbsp;(officially called the&nbsp;Request for Certification of Military or Naval Service)</p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->Proof of medical disability</p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->Form N-648&nbsp;(officially called the&nbsp;Medical Certification for Disability Exceptions)</p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->Applicants requesting an&nbsp;<a href=\"https://www.boundless.com/immigration-resources/u-s-citizenship-test-explained/#exempt-applicants\">exemption from the citizenship test</a>&nbsp;based on a qualifying medical conditionFee&nbsp;reduction&nbsp;application</p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]--><a href=\"https://www.uscis.gov/i-942\">Form I-942</a>&nbsp;(officially called the&nbsp;Request for Reduced Fee)</p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->Fee&nbsp;&nbsp;waiver&nbsp;application (if applicable)</p>\r\n\r\n<p><!--[if !supportLists]-->&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <!--[endif]-->Form I-912&nbsp;(officially called the&nbsp;Request for Fee Waiver)</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n');
